import React from 'react';

function Footer() {
  return (
    <footer style={styles.footer}>
      <p style={styles.text}>
        Made with <span role="img" aria-label="heart">❤️</span> in India
      </p>
    </footer>
  );
}

const styles = {
  footer: {
    backgroundColor: '#f8f9fa',
    padding: '1rem',
    textAlign: 'center',
    position: 'fixed',
    left: 0,
    bottom: 0,
    width: '100%',
    borderTop: '1px solid #e7e7e7',
  },
  text: {
    margin: 0,
    fontSize: '0.9rem',
    color: '#6c757d',
  },
};

export default Footer;
